import React from "react";


function Card(props) {
  return (
    <div className="catalog-box">
      <img alt="img" src= {props.imgUrl} />
      <h5>{props.productName}</h5>
      <span className="price">{props.price}</span>
    </div>
  );
}

export default Card;
